import React from 'react';
import Button from './components/Button'; 
import { FaBeer, FaHandHoldingMedical, FaPumpMedical } from 'react-icons/fa'; 

const App: React.FC = () => {
  return (
    <div style={{ padding: '30px' }}>
      <Button
        label="POLI UMUM"
        icon={FaPumpMedical}
        iconPosition="left"
        size="medium"
        variant="left" 
        tooltip="Klik untuk berobat ke dokter umum"
        tooltipPosition="top"
        onClick={() => alert('Anda memilih poli umum')}
      />
      <Button
        label="POLI KHUSUS"
        icon={FaHandHoldingMedical}
        iconPosition="right"
        size="medium"
        variant="right" 
        tooltip="Klik untuk berobat ke dokter spesialis"
        tooltipPosition="bottom"
        onClick={() => alert('Anda memilih pli khusus')}
      />
    </div>
  );
};

export default App;
